import React from 'react';
import Navbar from './UI/navbar.jsx';
import Header from './UI/header.jsx';
import '../';

const Layout = ({ children }) => {
  return (
    <>
      <Header />
      <Navbar />
      <main className="content">{children}</main>
    </>
  );
};

export default Layout;
